import { SoccerPlayer } from "./Components/SoccerPlayer";

import "./App.css";

import bg from "./halisaha.png";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={bg}>
          <SoccerPlayer />
        </img>
      </header>
    </div>
  );
}

export default App;
